from typing import List

class TrieNode:
    def __init__(self):
        self.children = {}
        self.prefix_count = 0  # To keep track of how many words share this prefix

class Trie:
    def __init__(self):
        self.root = TrieNode()
    
    def insert(self, word: str):
        current = self.root
        for char in word:
            if char not in current.children:
                current.children[char] = TrieNode()
            current = current.children[char]
            current.prefix_count += 1  # Increment the count as this prefix is used

    def countPrefix(self, word: str) -> int:
        current = self.root
        prefix_score = 0
        for char in word:
            if char in current.children:
                current = current.children[char]
                prefix_score += current.prefix_count  # Add the count of the prefix
        return prefix_score


class Solution:
    def sumPrefixScores(self, words: List[str]) -> List[int]:
        trie = Trie()
        
        # Step 1: Insert all words into the Trie
        for word in words:
            trie.insert(word)
        
        # Step 2: Calculate prefix scores for each word
        result = []
        for word in words:
            result.append(trie.countPrefix(word))
        
        return result
        
        
        
